/*Table structure for table `sy_file_record` */

DROP TABLE IF EXISTS `sy_file_record`;

CREATE TABLE `sy_file_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '上传的文件记录',
  `original_name` varchar(255) NOT NULL COMMENT '原文件名字',
  `file_md5` varchar(255) NOT NULL COMMENT '文件的md5值',
  `store_path` varchar(255) NOT NULL COMMENT '存储路径',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `store_path_unique_btree` (`store_path`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

